description:
I listen to these every day to unwind after a hard days work.  I really enjoy them, and I hope you will too.

   1. &quot;Break On Through (To The Other Side)&quot; (Jim Morrison)
   2. &quot;Light My Fire&quot;
   3. &quot;Love Me Two Times&quot;
   4. &quot;Hello, I Love You&quot;
   5. &quot;People Are Strange&quot;
   6. &quot;Strange Days&quot;
   7. &quot;Riders On The Storm&quot;
   8. &quot;L.A. Woman&quot;
   9. &quot;Touch Me&quot; (Robby Krieger)
  10. &quot;Roadhouse Blues&quot;
  11. &quot;Peace Frog&quot; (Jim Morrison and Robby Krieger)
  12. &quot;Love Street&quot;
  13. &quot;The Crystal Ship&quot; (Jim Morrison)
  14. &quot;Soul Kitchen&quot;
  15. &quot;Love Her Madly&quot; (Robby Krieger)
  16. &quot;Back Door Man&quot; (Willie Dixon and Chester Burnett)
  17. &quot;Alabama Song (Whiskey Bar)&quot; (Kurt Weill and Bertolt Brecht)
  18. &quot;Moonlight Drive&quot;
  19. &quot;The Unknown Soldier&quot;
  20. &quot;The End&quot; [edited version from Apocalypse Now]

Thanks and Enjoy. :^)
